import React from 'react';
import { useParams, useState, useEffect } from 'react-router-dom';
import Navbar from '../../component/Navbar/Navbar';
import Footer from '../../component/Footer/Footer';

const Detail = () => {
    const { id } = useParams();
    const [weather, setWeather] = useState();

    useEffect(() => {
      const fetchWeather = async () => {
        try {
          const weatherData = await getDetails(id);
          setweather(weatherData);
        } catch (error) {
          console.error("Error fetching weathers:", error);
        }
      };

      fetchWeather();
    }, [id]);

    if (!weather) {
      return <div>Loading...</div>;  
    }

    const {jamCuaca, cd: kodeCuaca, c: cuaca, o: humidty, cp: tempC, s:tempF } = weather;

    return (
        <div>
            <Navbar/>
            <p>Parameter id : {id}</p>
            <p>{jamCuaca}</p>
            <p>{kodeCuaca}</p>
            <Footer />
        </div>
    );
};

export default Detail;
